import React from "react";
import "./NavBar.css";

function NavBar() {
  return (
    <div classNameName="container nav-bar">
      <div classNameName="logo">LOGO</div>
      <div classNameName="nav">NAV</div>
      <div classNameName="spacer"></div>
      <div classNameName="spacer"></div>
    </div>
  );
}

export default NavBar;
